import React from 'react';
import {useCart} from 'react-use-cart';
import {CartProvider} from 'react-use-cart';


const Cart = () => {
    const {
        isEmpty,
        totalUniqueItems,
        items,
        totalItems,
        cartTotal,
        updateItemQuantity,
        removeItem,
        emptyCart
    } = useCart();

    if(isEmpty) return <h4 className='text-center py-5'>Your cart is empty<img src={require("../assets/cart.png")} height='33px'/></h4>;

  return (
    <CartProvider id='cart'>
        <div className='container-fluid'>

        </div>

    </CartProvider>
  )
}

export default Cart
